--
-- Name: check_username_availability(text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.check_username_availability(p_username text) RETURNS boolean
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  v_count INTEGER;
BEGIN
  -- Case-insensitive check
  SELECT COUNT(*) INTO v_count
  FROM public.users
  WHERE LOWER(username) = LOWER(TRIM(p_username));
  
  RETURN v_count = 0;
END;
$$;


