    total_study_minutes integer DEFAULT 0,
    sound_enabled boolean DEFAULT true,
    volume integer DEFAULT 80,
    music_volume integer DEFAULT 50,
    level_system_enabled boolean DEFAULT true,
    last_login_date date,
    last_login timestamp with time zone,
    created_at timestamp with time zone DEFAULT now(),
    updated_at timestamp with time zone DEFAULT now(),
    auth_user_id uuid,
    timer_pomodoro_minutes integer DEFAULT 25,
    timer_short_break_minutes integer DEFAULT 5,
    timer_long_break_minutes integer DEFAULT 15,
    pomodoros_before_long_break integer DEFAULT 4,
    auto_start_breaks boolean DEFAULT false,
    auto_start_pomodoros boolean DEFAULT false,
    background_id text DEFAULT 'room-video'::text,
