--
-- Name: trigger_calculate_level_prestige(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.trigger_calculate_level_prestige() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
  v_xp_per_cycle INTEGER := 19000; -- Sum(100+200+...+1900)
  v_max_level INTEGER := 20;
  v_prestige INTEGER;
  v_remaining INTEGER;
  v_level INTEGER;
BEGIN
  -- Only recalculate if XP changed
  IF NEW.xp IS DISTINCT FROM OLD.xp OR TG_OP = 'INSERT' THEN
    -- Calculate prestige (full cycles of 19000 XP)
    v_prestige := COALESCE(NEW.xp, 0) / v_xp_per_cycle;
    v_remaining := COALESCE(NEW.xp, 0) % v_xp_per_cycle;

    -- Calculate level from remaining XP
    v_level := 1;
    WHILE v_level < v_max_level AND v_remaining >= (v_level * 100) LOOP
      v_remaining := v_remaining - (v_level * 100);
      v_level := v_level + 1;
    END LOOP;

    -- Set calculated values
    NEW.level := v_level;
    NEW.prestige_level := v_prestige;
  END IF;

  RETURN NEW;
END;
$$;


ALTER FUNCTION public.trigger_calculate_level_prestige() OWNER TO postgres;

--
-- Name: FUNCTION trigger_calculate_level_prestige(); Type: COMMENT; Schema: public; Owner: postgres
--

COMMENT ON FUNCTION public.trigger_calculate_level_prestige() IS 'Auto-calculates level and prestige_level from total XP.
   Formula: prestige = floor(xp/19000), level derived from remainder.';


--
-- Name: unlock_milestone_reward(uuid, text, text, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.unlock_milestone_reward(p_user_id uuid, p_reward_type text, p_unlock_id text, p_milestone_id text DEFAULT NULL::text) RETURNS uuid
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  v_reward_id UUID;
BEGIN
  -- SECURITY: Verify caller owns this user profile
  IF auth.uid() IS NULL THEN
    RAISE EXCEPTION 'Authentication required';
  END IF;

  IF NOT EXISTS (
    SELECT 1 FROM public.users
    WHERE id = p_user_id AND auth_user_id = auth.uid()
  ) THEN
    RAISE EXCEPTION 'Unauthorized: Cannot unlock rewards for another user';
  END IF;

  -- Validate reward_type
  IF p_reward_type NOT IN ('background', 'theme', 'badge', 'playlist') THEN
    RAISE EXCEPTION 'Invalid reward_type: %', p_reward_type;
  END IF;

  -- Insert reward (or return existing if already unlocked)
  INSERT INTO public.user_unlocked_rewards (user_id, reward_type, unlock_id, milestone_id)
  VALUES (p_user_id, p_reward_type, p_unlock_id, p_milestone_id)
  ON CONFLICT (user_id, reward_type, unlock_id) DO NOTHING
  RETURNING id INTO v_reward_id;

  -- If already unlocked, fetch existing ID
  IF v_reward_id IS NULL THEN
    SELECT id INTO v_reward_id
    FROM public.user_unlocked_rewards
    WHERE user_id = p_user_id
      AND reward_type = p_reward_type
      AND unlock_id = p_unlock_id;
  END IF;

  RETURN v_reward_id;
END;
$$;


