-- Name: update_user_preferences(uuid, integer, integer, integer, integer, boolean, boolean, text, text, jsonb, boolean, integer, integer, boolean, integer, integer, integer, integer, integer, text, text, integer, text, integer, integer, text); Type: FUNCTION; Schema: public; Owner: postgres
