20250110	{"-- Create users table for Discord authentication\r\nCREATE TABLE IF NOT EXISTS public.users (\r\n  id UUID PRIMARY KEY DEFAULT uuid_generate_v4(),\r\n  discord_id TEXT UNIQUE NOT NULL,\r\n  username TEXT NOT NULL,\r\n  avatar TEXT,\r\n\r\n  -- Gamification data\r\n  level INTEGER DEFAULT 1 CHECK (level >= 1 AND level <= 20),\r\n  xp INTEGER DEFAULT 0 CHECK (xp >= 0),\r\n  prestige_level INTEGER DEFAULT 0 CHECK (prestige_level >= 0),\r\n  level_path TEXT DEFAULT 'human' CHECK (level_path IN ('elf', 'human')),\r\n\r\n  -- Activity tracking\r\n  consecutive_login_days INTEGER DEFAULT 1 CHECK (consecutive_login_days >= 0),\r\n  total_unique_days INTEGER DEFAULT 1 CHECK (total_unique_days >= 0),\r\n  total_pomodoros INTEGER DEFAULT 0 CHECK (total_pomodoros >= 0),\r\n  total_study_minutes INTEGER DEFAULT 0 CHECK (total_study_minutes >= 0),\r\n\r\n  -- Settings\r\n  sound_enabled BOOLEAN DEFAULT true,\r\n  volume INTEGER DEFAULT 80 CHECK (volume >= 0 AND volume <= 100),\r\n  music_volume INTEGER DEFAULT 50 CHECK (music_volume >= 0 AND music_volume <= 100),\r\n  level_system_enabled BOOLEAN DEFAULT true,\r\n\r\n  -- Timestamps\r\n  last_login_date DATE,\r\n  last_login TIMESTAMP WITH TIME ZONE,\r\n  created_at TIMESTAMP WITH TIME ZONE DEFAULT NOW(),\r\n  updated_at TIMESTAMP WITH TIME ZONE DEFAULT NOW()\r\n)","-- Create index on discord_id for fast lookups\r\nCREATE INDEX IF NOT EXISTS idx_users_discord_id ON public.users(discord_id)","-- Create index on last_login for activity queries\r\nCREATE INDEX IF NOT EXISTS idx_users_last_login ON public.users(last_login)","-- Enable Row Level Security\r\nALTER TABLE public.users ENABLE ROW LEVEL SECURITY","-- Create policy: Users can read their own data\r\nCREATE POLICY \\"Users can read own data\\"\r\n  ON public.users\r\n  FOR SELECT\r\n  USING (auth.uid()::text = discord_id OR true)","-- Allow read for now, can restrict later\r\n\r\n-- Create policy: Users can update their own data\r\nCREATE POLICY \\"Users can update own data\\"\r\n  ON public.users\r\n  FOR UPDATE\r\n  USING (auth.uid()::text = discord_id OR true)","-- Allow update for now, can restrict later\r\n\r\n-- Create policy: System can insert new users\r\nCREATE POLICY \\"System can insert users\\"\r\n  ON public.users\r\n  FOR INSERT\r\n  WITH CHECK (true)","-- Allow insert for now, can restrict later\r\n\r\n-- Create function to auto-update updated_at timestamp\r\nCREATE OR REPLACE FUNCTION public.update_updated_at_column()\r\nRETURNS TRIGGER AS $$\r\nBEGIN\r\n  NEW.updated_at = NOW();\r\n  RETURN NEW;\r\nEND;\r\n$$ LANGUAGE plpgsql","-- Create trigger to auto-update updated_at\r\nCREATE TRIGGER update_users_updated_at\r\n  BEFORE UPDATE ON public.users\r\n  FOR EACH ROW\r\n  EXECUTE FUNCTION public.update_updated_at_column()","-- Create completed_pomodoros table for session history\r\nCREATE TABLE IF NOT EXISTS public.completed_pomodoros (\r\n  id UUID PRIMARY KEY DEFAULT uuid_generate_v4(),\r\n  user_id UUID NOT NULL REFERENCES public.users(id) ON DELETE CASCADE,\r\n  discord_id TEXT NOT NULL,\r\n\r\n  -- Session data\r\n  duration_minutes INTEGER NOT NULL CHECK (duration_minutes > 0),\r\n  xp_earned INTEGER NOT NULL DEFAULT 0,\r\n  task_name TEXT,\r\n  notes TEXT,\r\n\r\n  -- Timestamps\r\n  completed_at TIMESTAMP WITH TIME ZONE DEFAULT NOW(),\r\n  created_at TIMESTAMP WITH TIME ZONE DEFAULT NOW()\r\n)","-- Create index on user_id for user queries\r\nCREATE INDEX IF NOT EXISTS idx_completed_pomodoros_user_id\r\n  ON public.completed_pomodoros(user_id)","-- Create index on discord_id for Discord-based queries\r\nCREATE INDEX IF NOT EXISTS idx_completed_pomodoros_discord_id\r\n  ON public.completed_pomodoros(discord_id)","-- Create index on completed_at for time-based queries\r\nCREATE INDEX IF NOT EXISTS idx_completed_pomodoros_completed_at\r\n  ON public.completed_pomodoros(completed_at DESC)","-- Enable Row Level Security\r\nALTER TABLE public.completed_pomodoros ENABLE ROW LEVEL SECURITY","-- Create policy: Users can read their own pomodoros\r\nCREATE POLICY \\"Users can read own pomodoros\\"\r\n  ON public.completed_pomodoros\r\n  FOR SELECT\r\n  USING (discord_id = auth.uid()::text OR true)","-- Create policy: Users can insert their own pomodoros\r\nCREATE POLICY \\"Users can insert own pomodoros\\"\r\n  ON public.completed_pomodoros\r\n  FOR INSERT\r\n  WITH CHECK (true)","COMMENT ON TABLE public.users IS 'User accounts synced from Discord'","COMMENT ON TABLE public.completed_pomodoros IS 'History of completed pomodoro sessions'"}	create_users_table	\N	\N	\N
20250117000000	{"-- Add pomodoro boost fields to users table\r\nALTER TABLE public.users\r\nADD COLUMN IF NOT EXISTS pomodoro_boost_active BOOLEAN DEFAULT false,\r\nADD COLUMN IF NOT EXISTS pomodoro_boost_expires_at BIGINT DEFAULT NULL","COMMENT ON COLUMN public.users.pomodoro_boost_active IS 'Whether +25% XP boost is currently active'","COMMENT ON COLUMN public.users.pomodoro_boost_expires_at IS 'Unix timestamp (milliseconds) when boost expires'"}	add_pomodoro_boost_fields	\N	\N	\N
20250118000000	{"-- Migration: Add Daily Gift Tracking to Database\r\n-- Ensures daily gift claims are validated server-side and synced across devices\r\n\r\n-- ============================================================================\r\n-- 1. ADD DAILY GIFT TRACKING COLUMN\r\n-- ============================================================================\r\n\r\nALTER TABLE public.users\r\nADD COLUMN IF NOT EXISTS last_daily_gift_date TEXT","COMMENT ON COLUMN public.users.last_daily_gift_date IS 'Last date daily gift was claimed (YYYY-MM-DD format)'","-- ============================================================================\r\n-- 2. CREATE RPC FUNCTION: CLAIM DAILY GIFT (SERVER-SIDE VALIDATION)\r\n-- ============================================================================\r\n\r\nCREATE OR REPLACE FUNCTION public.claim_daily_gift(\r\n  p_user_id UUID,\r\n  p_xp_amount INTEGER,\r\n  p_activate_boost BOOLEAN DEFAULT false\r\n)\r\nRETURNS JSONB AS $$\r\nDECLARE\r\n  v_auth_user_id UUID;\r\n  v_today TEXT;\r\n  v_last_claim_date TEXT;\r\n  v_new_xp INTEGER;\r\n  v_boost_expires_at BIGINT;\r\nBEGIN\r\n  -- SECURITY: Verify authentication\r\n  IF auth.uid() IS NULL THEN\r\n    RAISE EXCEPTION 'Authentication required';\r\n  END IF;\r\n\r\n  -- Verify the user_id matches the caller's auth_user_id\r\n  SELECT auth_user_id INTO v_auth_user_id\r\n  FROM public.users\r\n  WHERE id = p_user_id;\r\n\r\n  IF v_auth_user_id IS NULL THEN\r\n    RAISE EXCEPTION 'User with id % not found', p_user_id;\r\n  END IF;\r\n\r\n  IF auth.uid() != v_auth_user_id THEN\r\n    RAISE EXCEPTION 'Unauthorized: Cannot claim gift for another user';\r\n  END IF;\r\n\r\n  -- Get today's date in YYYY-MM-DD format\r\n  v_today := TO_CHAR(NOW() AT TIME ZONE 'UTC', 'YYYY-MM-DD');\r\n\r\n  -- Check if gift was already claimed today\r\n  SELECT last_daily_gift_date INTO v_last_claim_date\r\n  FROM public.users\r\n  WHERE id = p_user_id;\r\n\r\n  IF v_last_claim_date = v_today THEN\r\n    -- Gift already claimed today\r\n    RETURN jsonb_build_object(\r\n      'success', false,\r\n      'message', 'Daily gift already claimed today',\r\n      'already_claimed', true\r\n    );\r\n  END IF;\r\n\r\n  -- Calculate boost expiration (24 hours from now in milliseconds)\r\n  IF p_activate_boost THEN\r\n    v_boost_expires_at := EXTRACT(EPOCH FROM NOW() + INTERVAL '24 hours') * 1000;\r\n  ELSE\r\n    v_boost_expires_at := NULL;\r\n  END IF;\r\n\r\n  -- Claim the gift: update XP and last_daily_gift_date atomically\r\n  UPDATE public.users\r\n  SET\r\n    xp = xp + p_xp_amount,\r\n    last_daily_gift_date = v_today,\r\n    pomodoro_boost_active = CASE WHEN p_activate_boost THEN true ELSE pomodoro_boost_active END,\r\n    pomodoro_boost_expires_at = CASE WHEN p_activate_boost THEN v_boost_expires_at ELSE pomodoro_boost_expires_at END,\r\n    updated_at = NOW()\r\n  WHERE id = p_user_id\r\n  RETURNING xp INTO v_new_xp;\r\n\r\n  IF NOT FOUND THEN\r\n    RAISE EXCEPTION 'Failed to update user data';\r\n  END IF;\r\n\r\n  -- Return success with new XP value\r\n  RETURN jsonb_build_object(\r\n    'success', true,\r\n    'message', 'Daily gift claimed successfully',\r\n    'xp_awarded', p_xp_amount,\r\n    'new_xp', v_new_xp,\r\n    'boost_activated', p_activate_boost,\r\n    'boost_expires_at', v_boost_expires_at\r\n  );\r\nEND;\r\n$$ LANGUAGE plpgsql SECURITY DEFINER","-- Grant execute to authenticated users\r\nGRANT EXECUTE ON FUNCTION public.claim_daily_gift(UUID, INTEGER, BOOLEAN) TO authenticated","COMMENT ON FUNCTION public.claim_daily_gift IS\r\n  'Atomically claim daily gift with server-side validation.\r\n   Prevents claiming multiple times per day and ensures consistency across devices.\r\n   Returns success status and new XP value.'","-- ============================================================================\r\n-- 3. CREATE HELPER FUNCTION: CHECK IF GIFT CAN BE CLAIMED\r\n-- ============================================================================\r\n\r\nCREATE OR REPLACE FUNCTION public.can_claim_daily_gift(\r\n  p_user_id UUID\r\n)\r\nRETURNS BOOLEAN AS $$\r\nDECLARE\r\n  v_auth_user_id UUID;\r\n  v_today TEXT;\r\n  v_last_claim_date TEXT;\r\nBEGIN\r\n  -- SECURITY: Verify authentication\r\n  IF auth.uid() IS NULL THEN\r\n    RETURN false;\r\n  END IF;\r\n\r\n  -- Verify the user_id matches the caller's auth_user_id\r\n  SELECT auth_user_id INTO v_auth_user_id\r\n  FROM public.users\r\n  WHERE id = p_user_id;\r\n\r\n  IF v_auth_user_id IS NULL OR auth.uid() != v_auth_user_id THEN\r\n    RETURN false;\r\n  END IF;\r\n\r\n  -- Get today's date in YYYY-MM-DD format\r\n  v_today := TO_CHAR(NOW() AT TIME ZONE 'UTC', 'YYYY-MM-DD');\r\n\r\n  -- Check if gift was already claimed today\r\n  SELECT last_daily_gift_date INTO v_last_claim_date\r\n  FROM public.users\r\n  WHERE id = p_user_id;\r\n\r\n  -- Can claim if never claimed before OR last claim was not today\r\n  RETURN (v_last_claim_date IS NULL OR v_last_claim_date != v_today);\r\nEND;\r\n$$ LANGUAGE plpgsql SECURITY DEFINER","-- Grant execute to authenticated users\r\nGRANT EXECUTE ON FUNCTION public.can_claim_daily_gift(UUID) TO authenticated","COMMENT ON FUNCTION public.can_claim_daily_gift IS\r\n  'Check if user can claim daily gift today.\r\n   Returns true if gift has not been claimed today, false otherwise.'"}	add_daily_gift_tracking	\N	\N	\N
20251110153334	{"-- Fix Row Level Security Policies\r\n-- Remove overly permissive \\"OR true\\" clauses that bypass security\r\n\r\n-- Drop existing overly permissive policies\r\nDROP POLICY IF EXISTS \\"Users can read own data\\" ON public.users","DROP POLICY IF EXISTS \\"Users can update own data\\" ON public.users","DROP POLICY IF EXISTS \\"System can insert users\\" ON public.users","DROP POLICY IF EXISTS \\"Users can read own pomodoros\\" ON public.completed_pomodoros","DROP POLICY IF EXISTS \\"Users can insert own pomodoros\\" ON public.completed_pomodoros","-- Create secure policies for users table\r\nCREATE POLICY \\"Users can read own data\\"\r\n  ON public.users\r\n  FOR SELECT\r\n  TO authenticated\r\n  USING (discord_id = auth.uid()::text)","CREATE POLICY \\"Users can update own data\\"\r\n  ON public.users\r\n  FOR UPDATE\r\n  TO authenticated\r\n  USING (discord_id = auth.uid()::text)","CREATE POLICY \\"Users can insert own data\\"\r\n  ON public.users\r\n  FOR INSERT\r\n  TO authenticated\r\n  WITH CHECK (discord_id = auth.uid()::text)","-- Create secure policies for completed_pomodoros table\r\nCREATE POLICY \\"Users can read own pomodoros\\"\r\n  ON public.completed_pomodoros\r\n  FOR SELECT\r\n  TO authenticated\r\n  USING (discord_id = auth.uid()::text)","CREATE POLICY \\"Users can insert own pomodoros\\"\r\n  ON public.completed_pomodoros\r\n  FOR INSERT\r\n  TO authenticated\r\n  WITH CHECK (discord_id = auth.uid()::text)","COMMENT ON POLICY \\"Users can read own data\\" ON public.users IS 'Users can only read their own profile data'","COMMENT ON POLICY \\"Users can update own data\\" ON public.users IS 'Users can only update their own profile data'","COMMENT ON POLICY \\"Users can insert own data\\" ON public.users IS 'Users can only insert their own profile'","COMMENT ON POLICY \\"Users can read own pomodoros\\" ON public.completed_pomodoros IS 'Users can only read their own pomodoro history'","COMMENT ON POLICY \\"Users can insert own pomodoros\\" ON public.completed_pomodoros IS 'Users can only insert their own pomodoro sessions'"}	fix_rls_policies	\N	\N	\N
20251129003516	{"-- Buff System Migration\n-- Adds JSONB column to track active time-limited buffs per user\n\n-- ============================================================================\n-- 1. ADD ACTIVE BUFFS COLUMN\n-- ============================================================================\n\nALTER TABLE public.users\nADD COLUMN IF NOT EXISTS active_buffs JSONB DEFAULT '{}'::jsonb;\n\nCOMMENT ON COLUMN public.users.active_buffs IS\n  'Active time-limited buffs in JSONB format.\n   Structure: {\n     \\"buff_id\\": {\n       \\"expires_at\\": 1732223400000,  -- Unix timestamp in milliseconds (null = permanent)\n       \\"value\\": 0.25,                 -- Buff value (e.g., 0.25 = +25%)\n       \\"metadata\\": {}                 -- Optional extra data\n     }\n   }\n\n   Example:\n   {\n     \\"day10_boost\\": {\\"expires_at\\": 1732223400000, \\"value\\": 0.25},\n     \\"slingshot_nov22\\": {\\"expires_at\\": null, \\"value\\": 0.25}\n   }';\n\n-- ============================================================================\n-- 2. HELPER FUNCTION: GET ACTIVE BUFFS (FILTERS EXPIRED)\n-- ============================================================================\n\nCREATE OR REPLACE FUNCTION public.get_active_buffs(p_user_id UUID)\nRETURNS JSONB AS $$\nDECLARE\n  v_buffs JSONB;\n  v_buff_key TEXT;\n  v_buff_data JSONB;\n  v_expires_at BIGINT;\n  v_now BIGINT;\n  v_active_buffs JSONB := '{}'::jsonb;\nBEGIN\n  -- Get current timestamp in milliseconds\n  v_now := EXTRACT(EPOCH FROM NOW()) * 1000;\n\n  -- Get user's buffs\n  SELECT active_buffs INTO v_buffs\n  FROM public.users\n  WHERE id = p_user_id;\n\n  -- If no buffs, return empty object\n  IF v_buffs IS NULL OR v_buffs = '{}'::jsonb THEN\n    RETURN '{}'::jsonb;\n  END IF;\n\n  -- Filter out expired buffs\n  FOR v_buff_key IN SELECT jsonb_object_keys(v_buffs)\n  LOOP\n    v_buff_data := v_buffs -> v_buff_key;\n    v_expires_at := (v_buff_data ->> 'expires_at')::BIGINT;\n\n    -- Keep buff if no expiration or not yet expired\n    IF v_expires_at IS NULL OR v_expires_at > v_now THEN\n      v_active_buffs := v_active_buffs || jsonb_build_object(v_buff_key, v_buff_data);\n    END IF;\n  END LOOP;\n\n  RETURN v_active_buffs;\nEND;\n$$ LANGUAGE plpgsql;\n\nCOMMENT ON FUNCTION public.get_active_buffs IS\n  'Returns only active (non-expired) buffs for a user.\n   Filters out expired buffs based on current timestamp.';\n\n-- ============================================================================\n-- 3. HELPER FUNCTION: ADD/UPDATE BUFF\n-- ============================================================================\n\nCREATE OR REPLACE FUNCTION public.set_user_buff(\n  p_user_id UUID,\n  p_buff_id TEXT,\n  p_value NUMERIC,\n  p_expires_at BIGINT DEFAULT NULL,\n  p_metadata JSONB DEFAULT '{}'::jsonb\n)\nRETURNS VOID AS $$\nDECLARE\n  v_buff_data JSONB;\nBEGIN\n  -- Build buff data\n  v_buff_data := jsonb_build_object(\n    'value', p_value,\n    'expires_at', p_expires_at,\n    'metadata', p_metadata\n  );\n\n  -- Update user's active_buffs by merging in the new buff\n  UPDATE public.users\n  SET\n    active_buffs = COALESCE(active_buffs, '{}'::jsonb) || jsonb_build_object(p_buff_id, v_buff_data),\n    updated_at = NOW()\n  WHERE id = p_user_id;\nEND;\n$$ LANGUAGE plpgsql;\n\nCOMMENT ON FUNCTION public.set_user_buff IS\n  'Add or update a buff for a user.\n   If buff already exists, it will be replaced.\n\n   Parameters:\n   - p_user_id: User UUID\n   - p_buff_id: Buff identifier (e.g., \\"slingshot_nov22\\")\n   - p_value: Buff value (e.g., 0.25 for +25%)\n   - p_expires_at: Expiration timestamp in milliseconds (NULL = permanent)\n   - p_metadata: Optional metadata as JSONB';\n\n-- ============================================================================\n-- 4. HELPER FUNCTION: REMOVE BUFF\n-- ============================================================================\n\nCREATE OR REPLACE FUNCTION public.remove_user_buff(\n  p_user_id UUID,\n  p_buff_id TEXT\n)\nRETURNS VOID AS $$\nBEGIN\n  UPDATE public.users\n  SET\n    active_buffs = active_buffs - p_buff_id,\n    updated_at = NOW()\n  WHERE id = p_user_id;\nEND;\n$$ LANGUAGE plpgsql;\n\nCOMMENT ON FUNCTION public.remove_user_buff IS\n  'Remove a specific buff from a user.';\n\n-- ============================================================================\n-- 5. HELPER FUNCTION: CLEAR EXPIRED BUFFS\n-- ============================================================================\n\nCREATE OR REPLACE FUNCTION public.clear_expired_buffs(p_user_id UUID)\nRETURNS VOID AS $$\nDECLARE\n  v_active_buffs JSONB;\nBEGIN\n  -- Get active buffs (already filters expired)\n  v_active_buffs := public.get_active_buffs(p_user_id);\n\n  -- Update user with only active buffs\n  UPDATE public.users\n  SET\n    active_buffs = v_active_buffs,\n    updated_at = NOW()\n  WHERE id = p_user_id;\nEND;\n$$ LANGUAGE plpgsql;\n\nCOMMENT ON FUNCTION public.clear_expired_buffs IS\n  'Remove all expired buffs from user.\n   Should be called periodically or before XP calculations.';\n\n-- ============================================================================\n-- 6. MIGRATE EXISTING BOOST DATA\n-- ============================================================================\n\n-- Migrate existing pomodoro_boost_active to new buff system\nDO $$\nDECLARE\n  v_user RECORD;\n  v_now BIGINT;\nBEGIN\n  v_now := EXTRACT(EPOCH FROM NOW()) * 1000;\n\n  FOR v_user IN\n    SELECT id, pomodoro_boost_expires_at\n    FROM public.users\n    WHERE pomodoro_boost_active = true\n      AND pomodoro_boost_expires_at IS NOT NULL\n      AND pomodoro_boost_expires_at > v_now\n  LOOP\n    -- Add day10_boost to active_buffs\n    PERFORM public.set_user_buff(\n      v_user.id,\n      'day10_boost',\n      0.25,\n      v_user.pomodoro_boost_expires_at,\n      '{}'::jsonb\n    );\n  END LOOP;\n\n  RAISE NOTICE 'Migrated % active boosts to new buff system',\n    (SELECT COUNT(*) FROM public.users WHERE pomodoro_boost_active = true);\nEND $$;\n\n-- ============================================================================\n-- 7. GRANT PERMISSIONS\n-- ============================================================================\n\nGRANT EXECUTE ON FUNCTION public.get_active_buffs(UUID) TO authenticated;\nGRANT EXECUTE ON FUNCTION public.set_user_buff(UUID, TEXT, NUMERIC, BIGINT, JSONB) TO authenticated;\nGRANT EXECUTE ON FUNCTION public.remove_user_buff(UUID, TEXT) TO authenticated;\nGRANT EXECUTE ON FUNCTION public.clear_expired_buffs(UUID) TO authenticated;\n\n-- ============================================================================\n-- 8. CREATE INDEX FOR PERFORMANCE\n-- ============================================================================\n\n-- GIN index for JSONB queries\nCREATE INDEX IF NOT EXISTS idx_users_active_buffs ON public.users USING GIN (active_buffs);\n\nCOMMENT ON INDEX idx_users_active_buffs IS\n  'GIN index for efficient JSONB queries on active_buffs column.';"}	add_buff_system	lexlarisa@hotmail.com	\N	\N
20251129003522	{"-- Add missing boost columns for buff system compatibility\n-- These columns support both legacy boost system and new active_buffs JSONB\n\n-- ============================================================================\n-- 1. ADD BOOST COLUMNS (backwards compatible with legacy code)\n-- ============================================================================\n\nALTER TABLE public.users ADD COLUMN IF NOT EXISTS pomodoro_boost_active BOOLEAN DEFAULT FALSE;\nALTER TABLE public.users ADD COLUMN IF NOT EXISTS pomodoro_boost_expires_at BIGINT;\n\nCOMMENT ON COLUMN public.users.pomodoro_boost_active IS 'Legacy: Whether user has active XP boost. Use active_buffs for new code.';\nCOMMENT ON COLUMN public.users.pomodoro_boost_expires_at IS 'Legacy: Boost expiration timestamp (ms). Use active_buffs for new code.';\n\n-- ============================================================================\n-- 2. ADD ACTIVE_BUFFS JSONB (flexible buff storage)\n-- ============================================================================\n\nALTER TABLE public.users ADD COLUMN IF NOT EXISTS active_buffs JSONB DEFAULT '{}'::jsonb;\n\nCOMMENT ON COLUMN public.users.active_buffs IS\n'Flexible buff storage as JSONB. Structure:\n{\n  \\"buff_id\\": {\n    \\"value\\": 0.25,           -- Buff multiplier (0.25 = +25%)\n    \\"expiresAt\\": 1732396800000,  -- Unix ms timestamp (null = permanent)\n    \\"metadata\\": {}           -- Optional extra data\n  }\n}\n\nCurrent buff IDs:\n- day10_boost: +25% XP for 24h (from day 10 daily gift)\n- slingshot_nov22: +25% XP (Nov 22-23 event, elf only)\n\nFuture buff IDs (examples):\n- weekend_warrior: +15% XP on weekends\n- streak_master: +10% XP at 7-day streak\n- prestige_bonus: +5% XP per prestige level\n- event_*: Time-limited event buffs\n';\n\n-- ============================================================================\n-- 3. CREATE INDEX FOR JSONB QUERIES\n-- ============================================================================\n\nCREATE INDEX IF NOT EXISTS idx_users_active_buffs ON public.users USING GIN (active_buffs);\n\n-- ============================================================================\n-- 4. HELPER FUNCTIONS FOR BUFF MANAGEMENT\n-- ============================================================================\n\n-- Set/update a buff\nCREATE OR REPLACE FUNCTION public.set_user_buff(\n  p_user_id UUID,\n  p_buff_id TEXT,\n  p_value NUMERIC,\n  p_expires_at BIGINT DEFAULT NULL,\n  p_metadata JSONB DEFAULT '{}'::jsonb\n)\nRETURNS VOID AS $$\nBEGIN\n  UPDATE public.users\n  SET\n    active_buffs = COALESCE(active_buffs, '{}'::jsonb) || jsonb_build_object(\n      p_buff_id,\n      jsonb_build_object(\n        'value', p_value,\n        'expiresAt', p_expires_at,\n        'metadata', p_metadata\n      )\n    ),\n    updated_at = NOW()\n  WHERE id = p_user_id;\nEND;\n$$ LANGUAGE plpgsql SECURITY DEFINER;\n\n-- Remove a buff\nCREATE OR REPLACE FUNCTION public.remove_user_buff(\n  p_user_id UUID,\n  p_buff_id TEXT\n)\nRETURNS VOID AS $$\nBEGIN\n  UPDATE public.users\n  SET\n    active_buffs = active_buffs - p_buff_id,\n    updated_at = NOW()\n  WHERE id = p_user_id;\nEND;\n$$ LANGUAGE plpgsql SECURITY DEFINER;\n\n-- Get active buffs (filters expired)\nCREATE OR REPLACE FUNCTION public.get_active_buffs(p_user_id UUID)\nRETURNS JSONB AS $$\nDECLARE\n  v_buffs JSONB;\n  v_result JSONB := '{}'::jsonb;\n  v_key TEXT;\n  v_buff JSONB;\n  v_expires BIGINT;\n  v_now BIGINT;\nBEGIN\n  v_now := EXTRACT(EPOCH FROM NOW()) * 1000;\n\n  SELECT active_buffs INTO v_buffs\n  FROM public.users WHERE id = p_user_id;\n\n  IF v_buffs IS NULL THEN\n    RETURN '{}'::jsonb;\n  END IF;\n\n  FOR v_key IN SELECT jsonb_object_keys(v_buffs)\n  LOOP\n    v_buff := v_buffs -> v_key;\n    v_expires := (v_buff ->> 'expiresAt')::BIGINT;\n\n    -- Keep if no expiration or not yet expired\n    IF v_expires IS NULL OR v_expires > v_now THEN\n      v_result := v_result || jsonb_build_object(v_key, v_buff);\n    END IF;\n  END LOOP;\n\n  RETURN v_result;\nEND;\n$$ LANGUAGE plpgsql;\n\n-- Clear expired buffs\nCREATE OR REPLACE FUNCTION public.clear_expired_buffs(p_user_id UUID)\nRETURNS VOID AS $$\nBEGIN\n  UPDATE public.users\n  SET\n    active_buffs = public.get_active_buffs(p_user_id),\n    updated_at = NOW()\n  WHERE id = p_user_id;\nEND;\n$$ LANGUAGE plpgsql SECURITY DEFINER;\n\n-- ============================================================================\n-- 5. GRANT PERMISSIONS\n-- ============================================================================\n\nGRANT EXECUTE ON FUNCTION public.set_user_buff(UUID, TEXT, NUMERIC, BIGINT, JSONB) TO authenticated;\nGRANT EXECUTE ON FUNCTION public.remove_user_buff(UUID, TEXT) TO authenticated;\nGRANT EXECUTE ON FUNCTION public.get_active_buffs(UUID) TO authenticated;\nGRANT EXECUTE ON FUNCTION public.clear_expired_buffs(UUID) TO authenticated;"}	add_boost_columns	lexlarisa@hotmail.com	\N	\N
20251129003525	{"-- Add prestige stars tracking with role information\n-- Each prestige star records which role the user had when earning it\n\n-- Add prestige_stars column to track earned stars\nALTER TABLE public.users\nADD COLUMN IF NOT EXISTS prestige_stars JSONB DEFAULT '[]'::jsonb;\n\nCOMMENT ON COLUMN public.users.prestige_stars IS\n  'Array of prestige stars earned with role info: [{\\"role\\": \\"elf\\", \\"earnedAt\\": \\"2025-01-15T10:30:00Z\\"}, ...]';\n\n-- Create function to award prestige star when reaching level 20\nCREATE OR REPLACE FUNCTION public.trigger_award_prestige_star()\nRETURNS TRIGGER AS $$\nDECLARE\n  v_star_count INTEGER;\nBEGIN\n  -- Only award star when transitioning TO level 20 (prestige up)\n  IF NEW.level = 20 AND (OLD.level != 20 OR OLD IS NULL) THEN\n    -- Count existing stars\n    v_star_count := jsonb_array_length(COALESCE(NEW.prestige_stars, '[]'::jsonb));\n\n    -- Only award if prestige_level matches star count (user just prestiged)\n    IF v_star_count < NEW.prestige_level THEN\n      -- Add new star with current role\n      NEW.prestige_stars := COALESCE(NEW.prestige_stars, '[]'::jsonb) ||\n        jsonb_build_array(\n          jsonb_build_object(\n            'role', NEW.level_path,\n            'earnedAt', NOW()\n          )\n        );\n    END IF;\n  END IF;\n\n  RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql;\n\nCOMMENT ON FUNCTION public.trigger_award_prestige_star IS\n  'Awards a prestige star when user reaches level 20, recording their current role';\n\n-- Create trigger to award stars\nDROP TRIGGER IF EXISTS award_prestige_star_on_level_20 ON public.users;\n\nCREATE TRIGGER award_prestige_star_on_level_20\n  BEFORE INSERT OR UPDATE OF level, prestige_level ON public.users\n  FOR EACH ROW\n  EXECUTE FUNCTION public.trigger_award_prestige_star();\n\nCOMMENT ON TRIGGER award_prestige_star_on_level_20 ON public.users IS\n  'Triggers prestige star award when reaching level 20';\n\n-- Backfill existing users: create stars based on current prestige level\nUPDATE public.users\nSET prestige_stars = (\n  SELECT jsonb_agg(\n    jsonb_build_object(\n      'role', level_path,\n      'earnedAt', created_at + (generate_series * interval '1 day')\n    )\n  )\n  FROM generate_series(0, prestige_level - 1)\n)\nWHERE prestige_level > 0 AND (prestige_stars IS NULL OR jsonb_array_length(prestige_stars) = 0);"}	add_prestige_stars	lexlarisa@hotmail.com	\N	\N
20251129003608	{"-- Update daily gift RPC functions to write to new buff system\n-- Integrates with active_buffs JSONB column for day 10 boost\n\n-- Drop existing functions first\nDROP FUNCTION IF EXISTS public.claim_daily_gift_xp(UUID);\nDROP FUNCTION IF EXISTS public.claim_daily_gift_xp_discord(TEXT);\n\n/**\n * UPDATE claim_daily_gift_xp (Web Mode)\n * Now writes day10 boost to active_buffs when granting day 10 gift\n */\nCREATE OR REPLACE FUNCTION public.claim_daily_gift_xp(\n  p_user_id UUID\n)\nRETURNS TABLE(\n  success BOOLEAN,\n  xp_awarded INTEGER,\n  consecutive_days INTEGER,\n  boost_activated BOOLEAN,\n  boost_expires_at BIGINT\n) AS $$\nDECLARE\n  v_today DATE := CURRENT_DATE;\n  v_last_login DATE;\n  v_consecutive INTEGER;\n  v_xp INTEGER;\n  v_new_consecutive INTEGER;\n  v_boost_expires_at BIGINT;\n  v_is_day_10 BOOLEAN := FALSE;\nBEGIN\n  -- SECURITY: Verify user owns this account\n  IF NOT EXISTS (\n    SELECT 1 FROM public.users\n    WHERE id = p_user_id AND auth_user_id = auth.uid()\n  ) THEN\n    RAISE EXCEPTION 'Not authorized';\n  END IF;\n\n  -- Get current state\n  SELECT last_login_date, consecutive_login_days\n  INTO v_last_login, v_consecutive\n  FROM public.users WHERE id = p_user_id;\n\n  -- Already claimed today - reject\n  IF v_last_login = v_today THEN\n    RETURN QUERY SELECT FALSE, 0, v_consecutive, FALSE, NULL::BIGINT;\n    RETURN;\n  END IF;\n\n  -- Calculate new streak (restarts after day 10)\n  IF v_consecutive >= 10 THEN\n    v_new_consecutive := 1;  -- Restart cycle\n  ELSE\n    v_new_consecutive := COALESCE(v_consecutive, 0) + 1;\n  END IF;\n\n  -- Check if this is day 10 (activates boost)\n  v_is_day_10 := (v_new_consecutive = 10);\n\n  -- Calculate XP (100 on day 10, else 50)\n  v_xp := CASE WHEN v_is_day_10 THEN 100 ELSE 50 END;\n\n  -- Calculate boost expiration (24 hours from now) if day 10\n  IF v_is_day_10 THEN\n    v_boost_expires_at := EXTRACT(EPOCH FROM (NOW() + INTERVAL '24 hours')) * 1000;\n  END IF;\n\n  -- Atomic update\n  UPDATE public.users SET\n    xp = xp + v_xp,\n    last_login_date = v_today,\n    consecutive_login_days = v_new_consecutive,\n    total_login_days = total_login_days + 1,\n    -- Legacy boost fields (backwards compatibility)\n    pomodoro_boost_active = v_is_day_10,\n    pomodoro_boost_expires_at = CASE WHEN v_is_day_10 THEN v_boost_expires_at ELSE NULL END,\n    -- NEW: Write to active_buffs using set_user_buff\n    active_buffs = CASE\n      WHEN v_is_day_10 THEN\n        COALESCE(active_buffs, '{}'::jsonb) || jsonb_build_object(\n          'day10_boost',\n          jsonb_build_object(\n            'value', 0.25,\n            'expires_at', v_boost_expires_at,\n            'metadata', jsonb_build_object('claimedAt', EXTRACT(EPOCH FROM NOW()) * 1000)\n          )\n        )\n      ELSE active_buffs\n    END,\n    updated_at = NOW()\n  WHERE id = p_user_id;\n\n  RETURN QUERY SELECT TRUE, v_xp, v_new_consecutive, v_is_day_10, v_boost_expires_at;\nEND;\n$$ LANGUAGE plpgsql SECURITY DEFINER;\n\n/**\n * UPDATE claim_daily_gift_xp_discord (Discord Mode)\n * Now writes day10 boost to active_buffs when granting day 10 gift\n */\nCREATE OR REPLACE FUNCTION public.claim_daily_gift_xp_discord(\n  p_discord_id TEXT\n)\nRETURNS TABLE(\n  success BOOLEAN,\n  xp_awarded INTEGER,\n  consecutive_days INTEGER,\n  boost_activated BOOLEAN,\n  boost_expires_at BIGINT\n) AS $$\nDECLARE\n  v_today DATE := CURRENT_DATE;\n  v_last_login DATE;\n  v_consecutive INTEGER;\n  v_xp INTEGER;\n  v_new_consecutive INTEGER;\n  v_boost_expires_at BIGINT;\n  v_is_day_10 BOOLEAN := FALSE;\nBEGIN\n  -- Get current state\n  SELECT last_login_date, consecutive_login_days\n  INTO v_last_login, v_consecutive\n  FROM public.users WHERE discord_id = p_discord_id;\n\n  -- User not found\n  IF NOT FOUND THEN\n    RAISE EXCEPTION 'User not found';\n  END IF;\n\n  -- Already claimed today - reject\n  IF v_last_login = v_today THEN\n    RETURN QUERY SELECT FALSE, 0, v_consecutive, FALSE, NULL::BIGINT;\n    RETURN;\n  END IF;\n\n  -- Calculate new streak (restarts after day 10)\n  IF v_consecutive >= 10 THEN\n    v_new_consecutive := 1;  -- Restart cycle\n  ELSE\n    v_new_consecutive := COALESCE(v_consecutive, 0) + 1;\n  END IF;\n\n  -- Check if this is day 10 (activates boost)\n  v_is_day_10 := (v_new_consecutive = 10);\n\n  -- Calculate XP (100 on day 10, else 50)\n  v_xp := CASE WHEN v_is_day_10 THEN 100 ELSE 50 END;\n\n  -- Calculate boost expiration (24 hours from now) if day 10\n  IF v_is_day_10 THEN\n    v_boost_expires_at := EXTRACT(EPOCH FROM (NOW() + INTERVAL '24 hours')) * 1000;\n  END IF;\n\n  -- Atomic update\n  UPDATE public.users SET\n    xp = xp + v_xp,\n    last_login_date = v_today,\n    consecutive_login_days = v_new_consecutive,\n    total_login_days = total_login_days + 1,\n    -- Legacy boost fields (backwards compatibility)\n    pomodoro_boost_active = v_is_day_10,\n    pomodoro_boost_expires_at = CASE WHEN v_is_day_10 THEN v_boost_expires_at ELSE NULL END,\n    -- NEW: Write to active_buffs\n    active_buffs = CASE\n      WHEN v_is_day_10 THEN\n        COALESCE(active_buffs, '{}'::jsonb) || jsonb_build_object(\n          'day10_boost',\n          jsonb_build_object(\n            'value', 0.25,\n            'expires_at', v_boost_expires_at,\n            'metadata', jsonb_build_object('claimedAt', EXTRACT(EPOCH FROM NOW()) * 1000)\n          )\n        )\n      ELSE active_buffs\n    END,\n    updated_at = NOW()\n  WHERE discord_id = p_discord_id;\n\n  RETURN QUERY SELECT TRUE, v_xp, v_new_consecutive, v_is_day_10, v_boost_expires_at;\nEND;\n$$ LANGUAGE plpgsql SECURITY DEFINER;\n\nCOMMENT ON FUNCTION public.claim_daily_gift_xp IS\n  'Claim daily login gift with server-side validation (Web mode).\n   Grants XP, updates streak, and activates day10 boost in new buff system.';\n\nCOMMENT ON FUNCTION public.claim_daily_gift_xp_discord IS\n  'Claim daily login gift with server-side validation (Discord mode).\n   Grants XP, updates streak, and activates day10 boost in new buff system.';"}	update_daily_gift_for_buffs	lexlarisa@hotmail.com	\N	\N
